		array.add(new BlockRepresentation(entityPos.posX+5, entityPos.posY+1, entityPos.posZ+2, 0, 0, 3));     
		array.add(new BlockRepresentation(entityPos.posX+5, entityPos.posY+1, entityPos.posZ+3, 0, 0, 3));     
		array.add(new BlockRepresentation(entityPos.posX+5, entityPos.posY+1, entityPos.posZ+4, 0, 0, 3));     
		array.add(new BlockRepresentation(entityPos.posX+5, entityPos.posY+1, entityPos.posZ+5, 0, 0, 3));
		return array;
